import net.sf.json.groovy.*;

def items = context.expand( '${Display product confirmation business interaction items and return items 2#res_items}' )

def json = new JsonSlurper().parseText (items);

for (int i=0; i < json.size(); i++){

	if (json[i].quantity == 1 ) {
		//return json[i].id;
testRunner.testCase.testSteps['Properties'].setPropertyValue("itemId_3",json[i].id.toString());
testRunner.testCase.testSteps['Properties'].setPropertyValue("productId_3",json[i].productId.toString());}

	if (json[i].quantity == 2 ) {
		//return json[i].id;
testRunner.testCase.testSteps['Properties'].setPropertyValue("itemId_1_2",json[i].id.toString());
testRunner.testCase.testSteps['Properties'].setPropertyValue("productId_1_2",json[i].productId.toString());}										

	if (json[i].quantity == 3 ) {
		//return json[i].id;
testRunner.testCase.testSteps['Properties'].setPropertyValue("itemId_4_5_6",json[i].id.toString());
testRunner.testCase.testSteps['Properties'].setPropertyValue("productId_4_5_6",json[i].productId.toString());
	

																			
}}
